select `ttr_control_forms`.`id` AS `id`,`trnrs_all_cc`.`cedula` AS `cedula`,`userstemp`.`nombre_empleado` AS `nombre_entrenado`,`userstemp`.`cargo` AS `cargo_entrenado`,`userstemp`.`empresa` AS `empresa_entrenado`,`userstemp`.`canal` AS `canal_entrenado`,`userstemp`.`regional` AS `regional_entrenado`,`userstemp`.`plaza` AS `ciudad_entrenado`,`userstemp`.`linea_contacto` AS `linea_entrenado`,`trnrs_forvas33_data`.`latitud` AS `latitud`,`trnrs_forvas33_data`.`longitud` AS `longitud`,`ttr_control_forms`.`timestamp` AS `fecha_registro`,`trnrs_forvas33_data`.`fecha_actividad` AS `fecha_actividad`,`trnrs_forvas33_data`.`canal` AS `canal`,`trnrs_forvas33_data`.`nivel_entrenamiento` AS `nivel_entrenamiento`,`trnrs_forvas33_data`.`tema_entrenamiento` AS `tema_entrenamiento`,`trnrs_forvas33_data`.`se_hizo_evaluacion` AS `se_hizo_evaluacion`,`trnrs_forvas33_data`.`tiempo_entrenamiento` AS `tiempo_entrenamiento`,`trnrs_forvas33_data`.`observaciones` AS `observaciones`,`ttr_control_structure`.`id` AS `cedula_entrenador`,`ttr_control_structure`.`user_name` AS `nombre_entrenador`,`ttr_control_structure`.`user_regional` AS `regional_entrenador`,`ttr_control_structure`.`business_unit` AS `unidad_negocio` from ((((`trnrs_all_cc` join `trnrs_forvas33_data`) join `userstemp`) join `ttr_control_forms`) join `ttr_control_structure` on(((`trnrs_all_cc`.`form_id` = `ttr_control_forms`.`id`) and (`trnrs_forvas33_data`.`form_id` = `ttr_control_forms`.`id`) and (`ttr_control_forms`.`form` like '%for_vas_33%') and (`ttr_control_forms`.`user_id` = `ttr_control_structure`.`id`) and(`trnrs_all_cc`.`cedula` = `userstemp`.`cedula`))))
